function Validator(){}Validator.prototype.username=function(b){if(b.trim().length<4){return"USERNAME_SHORT"}if(b.trim().length>25){return"USERNAME_LONG"}if(/\s/g.test(b)){return"USERNAME_SPACES"}let regex=/^([a-zA-Z0-9]+)$/;if(!regex.test(b)){return"USERNAME_REGEX"}return true};Validator.prototype.email=function(b){if(/\s/g.test(b)){return"EMAIL_SPACES"}let regex=/^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;if(!regex.test(b)){return"EMAIL_INVALID"}return true};Validator.prototype.password=function(b){if(b.trim().length<8){return"PASSWORD_SHORT"}if(b.trim().length>45){return"PASSWORD_LONG"}if(/\s/g.test(b)){return"PASSWORD_SPACES"}if(b.match(/\d/g)===null){return"PASSWORD_NUMBER"}return true};Validator.prototype.password_repeat=function(b){let pass=$("input[name=password]").val();if(pass!==b){return"PASSWORD_MATCH"}return true};Validator.prototype.name=function(b){if(b.trim().length<1){return"NAME_SHORT"}if(b.trim().length>45){return"NAME_LONG"}return true};Validator.prototype.description=function(b){if(b.trim().length<6){return"DESC_SHORT"}if(b.trim().length>120){return"DESC_LONG"}return true};